        !signInState ? <Navigate to = "/signup"/> : signInState = !signInState
    }
    return (
        <header>
                <h1>Meme Generator</h1>
                <h4 className="signin" onClick={signInStateHandler}>Sign In</h4>
        </header>
    )
}

export default Header;
